tb_schema:
odps.Schema {
  biz_date                  string      
  index_id                  string      
  index_value               string      
  index_comment             string      
  update_type               string      
  stat_time                 string      
  create_time               string      
}
Partitions {
  dt                        string      # 分区日期
}

odps.Schema {
  id                      bigint          # 主键
  domain_name             string          # 域名名称
  gmt_create              datetime        # 创建时间
  gmt_modified            datetime        # 修改时间
}
Partitions {
  pt                      string          
}

odps.Schema {
  id                        bigint          # 主键
  domain_name               string          # 域名名称
  ip                        string          # 该域名绑定的DNS IP
  status                    string          # 该域名的DNS绑定状态
  dns_record_id             bigint          # AliDNS记录ID
  type                      string          # DNS记录类型
  gmt_create                datetime        # 创建时间
  gmt_modified              datetime        # 修改时间
}
Partitions {
  pt                        string          
}

odps.Schema {
  id                    bigint          # 主键
  group_name            string          # nginx的 group信息
  group_type            string          # http or https
  port                  bigint          # port
  gmt_created           datetime        # 创建时间
}
Partitions {
  pt                    string          
}

odps.Schema {
  id                    bigint          # 主键
  group_id              bigint          # nginx group id
  server_id             bigint          # nginx server id
  gmt_created           datetime        # 创建时间
}
Partitions {
  pt                    string          
}

odps.Schema {
  id                      bigint          # 自增id
  ip                      string          # ip
  host_name               string          # host_name
  intranet_ip             string          # intranet_ip
  control_port            bigint          # control_port
  group_id                bigint          # group_id
  status                  string          # status
  gmt_created             datetime        # gmt_created
}
Partitions {
  pt                      string          
}

odps.Schema {
  id                            bigint          # 自增id
  server_name                   string          # server_name
  port                          bigint          # port
  is_https                      bigint          # is_https
  server_type                   string          # server_type
  has_extend_prop               bigint          # has_extend_prop
  gmt_created                   datetime        # gmt_created
}
Partitions {
  pt                            string          
}

odps.Schema {
  id                      bigint          # 主键
  vip                     string          # 公网vip
  group_id                bigint          # vip分组id
  status                  string          # vip状态(NORMAL,DEFENSE,BLACKHOLE,PREWHITE,DISABLE)
  app_num                 bigint          # vip上app的数量
  gmt_create              datetime        # gmt_create
  gmt_modified            datetime        # gmt_modified
}
Partitions {
  pt                      string          
}

odps.Schema {
  id                      bigint          # id
  vip                     string          # vip
  app_uid                 string          # 应用唯一标志
  type                    string          # vip和app的绑定类型(FRONT_BOUND, DEFENSE_BOUND)
  gmt_create              datetime        # gmt_create
  gmt_modified            datetime        # gmt_modified
}
Partitions {
  pt                      string          
}

odps.Schema {
  id                      bigint          # id
  app_uid                 string          # app标识
  status                  string          # 预留字段
  gmt_create              datetime        # gmt_create
  gmt_modified            datetime        # gmt_modified
}
Partitions {
  pt                      string          
}

odps.Schema {
  id                          bigint          # id
  name                        string          # vip分组名称
  type                        string          # vip分组类型（FRONT, DEFENSE）
  region                      string          # vip分组所在域
  defense_status              string          # 清洗段状态(USED, IDLE)
  gmt_create                  datetime        # 创建时间
  gmt_modified                datetime        # 修改时间
}
Partitions {
  pt                          string          
}

odps.Schema {
  id                      bigint          # 主键
  gmt_create              datetime        # 创建时间
  gmt_modified            datetime        # 修改时间
  app_id                  bigint          # app的唯一标识
  app_key                 string          # appkey
  app_secret              string          # appsecret 加密后的
  is_removed              bigint          # 是否已删除
  app_code                string          # appcode加密后的
}
Partitions {
  pt                      string          
}

odps.Schema {
  id                          bigint          # 主键
  gmt_create                  datetime        # 创建时间
  gmt_modified                datetime        # 修改时间
  ip_control_id               string          # ip control id
  app_id                      string          # appId
  ip                          string          # ip
  policy_item_id              string          # 每条策略的id
  policy_type                 string          # 访问控制下细分类型
}
Partitions {
  pt                          string          
}

odps.Schema {
  id                              bigint          # 主键
  gmt_create                      datetime        # 创建时间
  gmt_modified                    datetime        # 修改时间
  token                           string          # 请求唯一标示符
  request_param                   string          # 请求参数
  request_param_id                string          # 请求参数唯一标示符
  status                          bigint          # 请求状态， 0:处理中，1:成功，2:失败
  result_message                  string          # 返回信息
}
Partitions {
  pt                              string          
}

odps.Schema {
  id                      bigint          # 主键
  gmt_create              datetime        # 创建时间
  gmt_modified            datetime        # 修改时间
  config_key              string          # 配置的key
  config_value            string          # 配置的value
  is_removed              bigint          # 是否已作废
}
Partitions {
  pt                      string          
}

odps.Schema {
  id                      bigint          # PK
  tag_id                  string          # tag编号
  api_id                  string          # api编号
  gmt_create              datetime        # 创建时间
  gmt_modified            datetime        # 变更时间
}
Partitions {
  pt                      string          
}

odps.Schema {
  id                      bigint          # PK
  gmt_create              datetime        # *
  gmt_modified            datetime        # *
  namespace               string          # 命名空间
  api_name                string          # api名称
  api_version             bigint          # api版本
  message_name            string          # 消息名
}
Partitions {
  pt                      string          
}

odps.Schema {
  id                      bigint          # PK
  gmt_create              datetime        # *
  gmt_modified            datetime        # *
  name                    string          # 业务唯一标识
  display_name            string          # 显示名称
  description             string          # 描述
  owner_scope             string          # resourceowner所属范围，如：ax, cbu, icbu
  status                  string          # 状态: enable,disable
}
Partitions {
  pt                      string          
}

odps.Schema {
  id                      bigint          # 主键
  gmt_create              datetime        # 创建时间
  gmt_modified            datetime        # 修改时间
  appkey                  bigint          # 证书关联的appkey
  alias                   string          # 证书别名
}
Partitions {
  pt                      string          
}
